		["Maiden of Vigilance - Soaking Assignments "] = {
			["outline"] = "OUTLINE",
			["parent"] = "Raid TOS - Fallen Avatar ",
			["displayText"] = "%c",
			["customText"] = "--Made by Pattisaurus@ScrubBusters\nfunction()\n    if aura_env.last and (GetTime() - aura_env.last) < 1 then\n        return aura_env.display\n    end\n    \n    aura_env.last = GetTime()\n    \n    aura_env.reset()\n    \n    if table.getn(aura_env.fel.players) == 0 then\n        for i=1, GetNumGroupMembers() do\n            aura_env.setSpellGroup(\"raid\" .. i)\n        end\n    end\n    \n    local display = \"\"\n    local found = false\n    for _, group in pairs(aura_env.groups) do\n        \n        display = string.format(\"%s%s%s\", display, aura_env[group].formattedName, \"\\n\")\n        \n        for _, data in pairs(aura_env[group].soakInfo) do\n            local i = 0\n            for _, role in pairs(data.prefer) do\n                for _, playerData in pairs(aura_env[group].players[role]) do\n                    if  i < data.required then\n                        if not playerData.assigned then                            \n                            local lane = aura_env.laneAssign(role, data.lanes, data.team)\n                            data.lanes[lane] = true\n                            table.insert(\n                                aura_env[group].soakPlayers[data.team],\n                                {name = playerData.name, [\"lane\"] = lane}\n                            )\n                            \n                            playerData.assigned = true\n                            i = i + 1\n                        end\n                    else \n                        break\n                    end \n                end\n            end\n        end\n        \n        if aura_env.all then\n            for team, players in pairs(aura_env[group].soakPlayers) do\n                display = string.format(\"%s%s%s%s\", display, \"|cffbbbbbb\",team, \"|r\\n\")\n                for _, player in pairs(players) do\n                    \n                    if player.name == aura_env.playerName then\n                        display = string.format(\"%s%s%s%s%s\", display, player.lane, \": \", aura_env.playerFormatted, \"\\n\")\n                    else\n                        display = string.format(\"%s%s%s%s%s\", display, player.lane, \": \", player.name, \"\\n\") \n                    end\n                end\n                \n                display = string.format(\"%s%s\", display, \"\\n\")\n            end\n        else \n            for team, players in pairs(aura_env[group].soakPlayers) do\n                for _, player in pairs(players) do\n                    if player.name == aura_env.playerName then\n                        display = string.format(\"%s%s%s\", team, \"\\n\", player.lane)\n                        found = true\n                        break\n                    end\n                end\n            end\n        end\n        \n        if found then\n            break\n        end\n    end\n    \n    if not aura_env.all and not found then\n        display = \"Free for all\"\n    end\n    \n    aura_env.display = display\n    return display\nend\n\n",
			["yOffset"] = 143.000549316406,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "update",
			["automaticWidth"] = "Auto",
			["actions"] = {
				["start"] = {
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "--Made by Pattisaurus@ScrubBusters\n--Add any players who shouldn't ever be assigned here. Leave empty if everyone should be assigned\naura_env.dontAssign = {\n    'Pattisaurus',\n}\n\n--Whether to only show your assignment or everyones assignment\naura_env.all = false\n\n--DO NOT EDIT BELOW\naura_env.test = false\naura_env.groups = {\"fel\", \"light\"}\naura_env.felIcon = \"|TInterface/Icons/Spell_Fire_FelFireNova:15:15:0:-8|t\"\naura_env.lightIcon = \"|TInterface/Icons/spell_paladin_lightofdawn:15:15:0:-8|t\"\n\nlocal _,class = UnitClass(\"player\")\nlocal color = RAID_CLASS_COLORS[class] and RAID_CLASS_COLORS[class].colorStr or \"ffbbbbbb\"\n\naura_env.playerName = UnitName(\"player\")\naura_env.playerFormatted = string.format(\"%s%s%s%s\", \"|c\", color, aura_env.playerName, \"|r\") \n\naura_env.setPlayerInfo = function(unit, spell)\n    local playerName = UnitName(unit)\n    \n    if aura_env.dontAssign then\n        for _, player in pairs(aura_env.dontAssign) do\n            if player == playerName then\n                return\n            end\n        end\n    end\n    \n    local role = UnitGroupRolesAssigned(unit)\n    \n    if role == \"DAMAGER\" then\n        role = aura_env.getDamageRole(unit)\n    end\n    \n    local insert = {name = playerName, assigned = false}\n    if role == \"HEALER\" then\n        table.insert(aura_env[spell].players.healer, insert)\n    elseif role == \"MELEE\" then\n        table.insert(aura_env[spell].players.melee, insert)\n    elseif role == \"RANGED\" then\n        table.insert(aura_env[spell].players.ranged, insert)\n    elseif \"TANK\" then\n        table.insert(aura_env[spell].players.tank, insert)\n    end\nend\n\naura_env.getDamageRole = function(unit)\n    local class = UnitClass(unit)\n    local role = \"\"\n    \n    if class == \"Hunter\" \n    or class == \"Mage\" \n    or class == \"Warlock\" \n    or class == \"Priest\"\n    or class == \"Shaman\" \n    or class == \"Druid\" then\n        role = \"RANGED\"\n    elseif class == \"Death Knight\" \n    or class == \"Demon Hunter\" \n    or class == \"Monk\" \n    or class == \"Paladin\" \n    or class == \"Rogue\" \n    or class == \"Warrior\" then\n        role = \"MELEE\"\n    end\n    \n    return role\nend\n\naura_env.laneAssign = function(role, lanes, team) \n    if role == \"healer\" and not lanes.Inside then\n        return \"Inside\"\n    elseif role == \"healer\" and not lanes.Middle then\n        return \"Middle\"\n    elseif role == \"healer\" and not lanes.Outside then\n        return \"Outside\"\n    end\n    \n    \n    for lane, taken in pairs(lanes) do\n        if not taken then\n            return lane\n        end\n    end\n    \n    return \"\"\nend\n\naura_env.felSpell = GetSpellInfo(235213)\naura_env.lightSpell = GetSpellInfo(235240)\n\naura_env.setSpellGroup = function(unit)    \n    \n    if UnitExists(unit) and not UnitIsDead(unit) then\n        if UnitDebuff(unit, aura_env.felSpell) then\n            aura_env.setPlayerInfo(unit, \"fel\")\n        elseif UnitDebuff(unit, aura_env.lightSpell) then\n            aura_env.setPlayerInfo(unit, \"light\")\n        end\n    end\nend\n\naura_env.normalReset = function()\n    local soakInfo = function() \n        return {\n            {team = \"Wrong Side\", required = 3, players = {}, \n                prefer={\"ranged\", \"healer\", \"tank\", \"melee\"}, \n                lanes = {Outside = false, Middle = false, Inside = false}\n            },\n            \n            {team = \"Same Side\", required = 3, players = {}, \n                prefer={\"melee\", \"tank\", \"ranged\", \"healer\"}, \n                lanes = {Outside = false, Middle = false, Inside = false}\n            },\n        }\n    end\n    \n    \n    local soakPlayers = function()\n        return {\n            [\"Wrong Side\"] = {},\n            [\"Same Side\"] = {},\n        }\n    end\n    \n    --The variable names are the wrong way around, but it doesnt matter...\n    aura_env.fel = { \n        formattedName = string.format(\"%s%s%s\", aura_env.lightIcon, \"Light\", aura_env.lightIcon),\n        players = {melee = {}, ranged = {}, healer = {}, tank = {}} ,\n        \n        [\"soakInfo\"] = soakInfo(),\n        \n        [\"soakPlayers\"] = soakPlayers()\n    }\n    \n    aura_env.light = { \n        formattedName = string.format(\"%s%s%s\", aura_env.felIcon, \"Fel\", aura_env.felIcon),\n        players = {melee = {}, ranged = {}, healer = {}, tank = {}},\n        \n        [\"soakInfo\"] = soakInfo(),\n        \n        [\"soakPlayers\"] = soakPlayers()\n    }\nend\n\naura_env.reset = function()\n    aura_env.normalReset()\nend\n\naura_env.reset()",
