						["events"] = "COMBAT_LOG_EVENT_UNFILTERED IMP_COUNT_EVENT",
						["custom"] = "function(allstates, event, ...)\n    local timestamp = GetTime()\n    \n    if event == \"IMP_COUNT_EVENT\" then\n        local total_imps = 0\n        for cloneId, state in pairs(allstates) do\n            total_imps = total_imps + state.stacks\n        end\n        WA_TOTAL_IMPS = total_imps\n    end\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local _, subevent, _, sourceGUID = ...\n        local destGUID, destName = select(8, ...)\n        local spellid = select(12, ...) or 0\n        \n        if subevent == \"SPELL_SUMMON\" and sourceGUID == WeakAuras.myGUID and aura_env.include[spellid] then\n            allstates[timestamp] = allstates[timestamp] or {}\n            \n            \n            local _, _, icon = GetSpellInfo(spellid)\n            local state = allstates[timestamp]\n            local duration = 10\n            local stacks = state.stacks or 0\n            \n            state.name = destName\n            state.icon = GetSpellTexture(138685)\n            state.duration = duration\n            state.spellid = spellid\n            state.progressType = \"timed\"\n            state.expirationTime = timestamp + duration\n            state.stacks = stacks + 1\n            state.colour = \"\"\n            state.autoHide = true\n            state.changed = true\n            state.show = true\n            WeakAuras.ScanEvents(\"IMP_COUNT_EVENT\")\n        end\n        --check for demonic tyrant buffapplication\n        if subevent == \"SPELL_AURA_APPLIED\" and destGUID == WeakAuras.myGUID and spellid == 265273 then\n            if select(4, GetTalentInfo(7,2,1)) then\n                for cloneId, state in pairs(allstates) do\n                    state.show = false\n                    state.changed = true\n                end\n            else \n                for cloneId, state in pairs(allstates) do\n                    local previousExpiration = state.expirationTime\n                    state.expirationTime = previousExpiration + 15\n                    state.duration = (previousExpiration - GetTime()) + 15\n                    state.changed = true\n                    \n                end\n            end\n        end\n        \n        --check for implosion cast\n        if subevent == \"SPELL_CAST_SUCCESS\" and sourceGUID == WeakAuras.myGUID and spellid == 196277 then\n            for cloneId, state in pairs(allstates) do\n                state.show = false\n                state.changed = true\n            end\n        end\n    end\n    return true\nend",
