			["displayText"] = "%c",
			["customText"] = "function()\n    local t = aura_env.getIconTexture(aura_env.myPos)\n    local color = aura_env.getColor(aura_env.myPos)\n    return aura_env.myPos and (t .. color .. \"SOAK\" .. t) or \"don't soak\"\nend\n\n\n\n\n\n\n\n\n\n\n",
